2	1	data_provider	Durham county council	Durham_County_Council	2	2	\N	\N	2015-09-01 20:20:33.925769	2015-09-17 12:35:45.863817	Report built	\N	"wikipedia_content"=>"<p><b>Durham County Council</b> is the local authority of County Durham (excluding Darlington, Hartlepool and Stockton-on-Tees) in North East England. Since 2009 it has been a unitary authority, having the powers of a non-metropolitan county and district council combined. From 1889 to 2009 it was a county council in a two-tier arrangement.</p>\n<p>At the time of the 2011 census it served a population of 513,200, which makes it one of the most-populous local authorities in England. It has its headquarters at County Hall in Durham.</p>"	\N
5	1	data_provider	Imperial War Museums	Imperial_War_Museum	2	2	\N	\N	2015-09-01 21:48:52.759739	2015-09-17 12:35:45.866479	Report built	\N	"wikipedia_content"=>"<p><b>Imperial War Museums</b> (IWM) is a British national museum organisation with branches at five locations in England, three of which are in London. Founded as the Imperial War Museum in 1917, the museum was intended to record the civil and military war effort and sacrifice of Britain and its Empire during the First World War. The museum's remit has since expanded to include all conflicts in which British or Commonwealth forces have been involved since 1914. As of 2012, the museum aims 'to provide for, and to encourage, the study and understanding of the history of modern war and \\"wartime experience\\"'.</p>\n<p>Originally housed in the Crystal Palace at Sydenham Hill, the museum opened to the public in 1920. In 1924 the museum moved to space in the Imperial Institute in South Kensington, and finally in 1936 the museum acquired a permanent home which was previously the Bethlem Royal Hospital in Southwark. The outbreak of the Second World War saw the museum expand both its collections and its terms of reference, but in the post-war period the museum entered a period of decline. The 1960s saw the museum redevelop its Southwark building, now referred to as Imperial War Museum London, which serves as the organisation's corporate headquarters. During the 1970s the museum began to expand onto other sites. The first, in 1976, was a historic airfield in Cambridgeshire now referred to as IWM Duxford. In 1978 the Royal Navy cruiser HMSÂ <i>Belfast</i> became a branch of the museum, having previously been preserved for the nation by a private trust. In 1984 the Cabinet War Rooms, an underground wartime command centre, was opened to the public. From the 1980s onwards the museum's Bethlem building underwent a series of multimillion-pound redevelopments, completed in 2000. Finally, 2002 saw the opening of IWM North in Trafford, Greater Manchester, the fifth branch of the museum and the first in the north of England. In 2011 the museum rebranded itself as IWM, standing for 'Imperial War Museums'.</p>\n<p>The museum's collections include archives of personal and official documents, photographs, film and video material, and oral history recordings; an extensive library, a large art collection, and examples of military vehicles and aircraft, equipment and other artefacts.</p>\n<p>The museum is funded by government grants, charitable donations and revenue generation through commercial activity such as retailing, licensing, and publishing. Admission is free to IWM London and IWM North, but an admission fee is levied at the other branches. The museum is an exempt charity under the Charities Act 1993 and a non-departmental public body under the Department for Culture, Media and Sport. As of January 2012 the Chairman of the Trustees is Sir Francis Richards. Since October 2008, the museum's Director General has been Diane Lees.</p>\n<p></p>"	\N
3	1	data_provider	Biblioteca de Catalunya	National_Library_of_Catalonia	2	2	\N	\N	2015-09-01 21:33:21.959452	2015-09-17 12:35:45.869455	Report built	\N	"wikipedia_content"=>"<p>The <b>National Library of Catalonia</b> (Catalan: <span lang=\\"ca\\" xml:lang=\\"ca\\"><i>Biblioteca de Catalunya</i></span>, <small>IPA:Â </small><span title=\\"Representation in the International Phonetic Alphabet (IPA)\\">[biÎ²É«iuËtÉkÉ Ã°É kÉtÉËÉ«uÉ²É]</span>) is a Catalan national library located in Barcelona, Spain. The mission of the Library of Catalonia is to collect, preserve, and spread Catalonian bibliographic production and that related to the Catalonian linguistic area, to look after its conservation, and to spread its bibliographic heritage while maintaining the status of a center for research and consultation.</p>\n<p>It occupies 8,820 mÂ² and has about three million items.</p>\n<p></p>"	\N
4	1	data_provider	Amsterdam Museum	Amsterdam_Museum	2	2	\N	\N	2015-09-01 21:39:21.415387	2015-09-17 12:35:45.871143	Report built	\N	"wikipedia_content"=>"<p>The <b>Amsterdam Museum</b>, until 2011 called the <b>Amsterdams Historisch Museum</b>, is a museum about the history of Amsterdam. Since 1975, it is located in the old city orphanage between Kalverstraat and Nieuwezijds Voorburgwal.</p>\n<p></p>"	\N
6	1	data_provider	Rijksmuseum	Rijksmuseum	2	2	\N	\N	2015-09-01 21:58:14.30828	2015-09-17 12:35:45.838228	Report built	\N	"wikipedia_content"=>"<p>The <b>Rijksmuseum</b> (<small>Dutch pronunciation:</small> <span title=\\"Representation in the International Phonetic Alphabet (IPA)\\">[ËrÉiÌ¯ksmyËzeËjÊm]</span>; English: State Museum) is a Netherlands national museum dedicated to arts and history in Amsterdam. The museum is located at the Museum Square in the borough Amsterdam South, close to the Van Gogh Museum, the Stedelijk Museum Amsterdam, and the Concertgebouw.</p>\n<p>The Rijksmuseum was founded in The Hague in 1800 and moved to Amsterdam in 1808, where it was first located in the Royal Palace and later in the Trippenhuis. The current main building was designed by Pierre Cuypers and first opened its doors in 1885. On 13 April 2013, after a ten-year renovation which cost â¬ 375 million, the main building was reopened by Queen Beatrix. In 2013 and 2014, it was the most visited museum in the Netherlands with record numbers of 2.2 million and 2.45 million visitors.</p>\n<p>The museum has on display 8,000 objects of art and history, from their total collection of 1 million objects from the years 1200â2000, among which are some masterpieces by Rembrandt, Frans Hals, and Johannes Vermeer. The museum also has a small Asian collection which is on display in the Asian pavilion.</p>\n<p></p>"	\N
7	1	data_provider	National Library of Portugal	Biblioteca_Nacional_de_Portugal	2	2	\N	\N	2015-09-18 04:51:17.658127	2015-10-13 11:37:22.839105	Processed Collections	\N	"wikipedia_content"=>"<p>The <b><span lang=\\"pt\\" xml:lang=\\"pt\\">Biblioteca Nacional de Portugal</span></b> (Portuguese for <i>National Library of Portugal</i>) is the Portuguese national library, fulfilling the function of legal deposit and copyright.</p>\n<p></p>\n"	\N
