2	5	1	Imperial War Museums	imperial-war-museums	<div> <div class="row"> <div class="col-sm-12"> <p><b>Imperial War Museums</b> (IWM) is a British national museum organisation with branches at five locations in England, three of which are in London. Founded as the Imperial War Museum in 1917, the museum was intended to record the civil and military war effort and sacrifice of Britain and its Empire during the First World War. The museum's remit has since expanded to include all conflicts in which British or Commonwealth forces have been involved since 1914. As of 2012, the museum aims 'to provide for, and to encourage, the study and understanding of the history of modern war and "wartime experience"'.</p>\n<p>Originally housed in the Crystal Palace at Sydenham Hill, the museum opened to the public in 1920. In 1924 the museum moved to space in the Imperial Institute in South Kensington, and finally in 1936 the museum acquired a permanent home which was previously the Bethlem Royal Hospital in Southwark. The outbreak of the Second World War saw the museum expand both its collections and its terms of reference, but in the post-war period the museum entered a period of decline. The 1960s saw the museum redevelop its Southwark building, now referred to as Imperial War Museum London, which serves as the organisation's corporate headquarters. During the 1970s the museum began to expand onto other sites. The first, in 1976, was a historic airfield in Cambridgeshire now referred to as IWM Duxford. In 1978 the Royal Navy cruiser HMSÂ <i>Belfast</i> became a branch of the museum, having previously been preserved for the nation by a private trust. In 1984 the Cabinet War Rooms, an underground wartime command centre, was opened to the public. From the 1980s onwards the museum's Bethlem building underwent a series of multimillion-pound redevelopments, completed in 2000. Finally, 2002 saw the opening of IWM North in Trafford, Greater Manchester, the fifth branch of the museum and the first in the north of England. In 2011 the museum rebranded itself as IWM, standing for 'Imperial War Museums'.</p>\n<p>The museum's collections include archives of personal and official documents, photographs, film and video material, and oral history recordings; an extensive library, a large art collection, and examples of military vehicles and aircraft, equipment and other artefacts.</p>\n<p>The museum is funded by government grants, charitable donations and revenue generation through commercial activity such as retailing, licensing, and publishing. Admission is free to IWM London and IWM North, but an admission fee is levied at the other branches. The museum is an exempt charity under the Charities Act 1993 and a non-departmental public body under the Department for Culture, Media and Sport. As of January 2012 the Chairman of the Trustees is Sir Francis Richards. Since October 2008, the museum's Director General has been Diane Lees.</p>\n<p></p> </div> <div class="col-sm-12"> <div class="col-sm-3"> <div id='imperial_war_museums_-_collections' data-datacast_identifier='3fb41e769f03ab79c8f55d120ffeb80ee23b0718ee587d4104750f95d291105217' class='card_with_value' ></div> </div> </div> <div class="clearfix"></div> <div class="col-sm-12"> <h4>Ranking In Europeana</h4> <div class="col-sm-7"> <div id='imperial_war_museums_-_rankings' data-datacast_identifier='6de4ae83f13f98238f21124a46d2861fa1406a492351ce2c9e8fed04244b7ad198' class='box_table' ></div> </div> </div> <div class="col-sm-6"> <h4>Item Types</h4> <p>This chart displays a breakdown of the types of digital objects in this collection.</p> <div id='imperial_war_museums_-_media_types' data-api='PykCharts.multiD.column' data-datacast_identifier='4eb098332b4467b49745702374dce365495c59edb8170643fbe9de0df7e1c00efd' class='d3-pykcharts' data-filter_present='false' data-filter_column_name=''></div> </div> <div class="col-sm-6"> <h4>Open for Re-Use</h4> <p>This chart displays what percentage of the collection is open for re-use.</p> <div id='imperial_war_museums_-_reusables' data-api='PykCharts.oneD.pie' data-datacast_identifier='411c8b229b1e4ca1e1f0c047347366aca4065ba7e0aebbdf57e1e5af21ca7e7967' class='d3-pykcharts' data-filter_present='false' data-filter_column_name=''></div> </div> <div class="col-sm-12"> <p>Use the the year filter below to filter all of the charts under it.</p> <span> Select year to view collection statistics on a per-year basis: <span id="id_year_filters"></span> </span> <h4>Views & Click-Throughs</h4> <p>This chart displays the views of the collection on the Europeana.eu website together with the number of times a user clicked through to the website of the data provider. Click-throughs are not measured prior to April 2012. (Filter chart by year above)</p> <div id='imperial_war_museums_-_traffic' data-api='PykCharts.multiD.groupedColumn' data-datacast_identifier='450fc106a7d125d076fc34a692f1f8f9cce7c75e9a3ec2e2e1f06923cc2fb100da' class='d3-pykcharts' data-filter_present='true' data-filter_column_name=''></div> </div> <div class="col-sm-12"> <h4>Line Chart for Page view</h4> <p>This is a test visualization</p> <div id='imperial_war_museums_-_line_chart' data-api='PykCharts.multiD.multiSeriesLine' data-datacast_identifier='2081305c10c406d6c79cfbffc438624c6f3f8eda790af5c4e781b00dcf6debdb9d' class='d3-pykcharts' data-filter_present='true' data-filter_column_name=''></div> </div> <div class="col-sm-12"> <h4>Top 25 Countries</h4> <p>This chart displays the top 25 countries that generated the most views for this collection on Europeana.eu website. (Filter chart by year above and by quarter below)</p> <span id="id_quarter_filters"></span> </br> <div id='imperial_war_museums_-_top_countries' data-api='PykCharts.maps.oneLayer' data-datacast_identifier='a1eed8e0ae2b372d2c82982b901716e280ebae841776156f6852f9d449d03bc7c3' class='d3-pykcharts' data-filter_present='true' data-filter_column_name=''></div> </div> <div class="col-sm-12"> <h4>Top 10 Digital Objects</h4> <p>The list below displays the top 10 digital objects from the collection that generated the most views on Europeana.eu. (Filter list by year and quarter above)</p> <div id='imperial_war_museums_-_top_digital_objects' data-datacast_identifier='4ed715dfde1660a8f46bc8bdf2c19b87e2401d3e43f741d7815d4e5b7383d0a8b4' class='top_digital_objects'></div> </div> </div> </div>	{"$AGGREGATION_WIKIPEDIA_DESCRIPTION$":"\\u003cp\\u003e\\u003cb\\u003eImperial War Museums\\u003c/b\\u003e (IWM) is a British national museum organisation with branches at five locations in England, three of which are in London. Founded as the Imperial War Museum in 1917, the museum was intended to record the civil and military war effort and sacrifice of Britain and its Empire during the First World War. The museum's remit has since expanded to include all conflicts in which British or Commonwealth forces have been involved since 1914. As of 2012, the museum aims 'to provide for, and to encourage, the study and understanding of the history of modern war and \\"wartime experience\\"'.\\u003c/p\\u003e\\n\\u003cp\\u003eOriginally housed in the Crystal Palace at Sydenham Hill, the museum opened to the public in 1920. In 1924 the museum moved to space in the Imperial Institute in South Kensington, and finally in 1936 the museum acquired a permanent home which was previously the Bethlem Royal Hospital in Southwark. The outbreak of the Second World War saw the museum expand both its collections and its terms of reference, but in the post-war period the museum entered a period of decline. The 1960s saw the museum redevelop its Southwark building, now referred to as Imperial War Museum London, which serves as the organisation's corporate headquarters. During the 1970s the museum began to expand onto other sites. The first, in 1976, was a historic airfield in Cambridgeshire now referred to as IWM Duxford. In 1978 the Royal Navy cruiser HMSÂ \\u003ci\\u003eBelfast\\u003c/i\\u003e became a branch of the museum, having previously been preserved for the nation by a private trust. In 1984 the Cabinet War Rooms, an underground wartime command centre, was opened to the public. From the 1980s onwards the museum's Bethlem building underwent a series of multimillion-pound redevelopments, completed in 2000. Finally, 2002 saw the opening of IWM North in Trafford, Greater Manchester, the fifth branch of the museum and the first in the north of England. In 2011 the museum rebranded itself as IWM, standing for 'Imperial War Museums'.\\u003c/p\\u003e\\n\\u003cp\\u003eThe museum's collections include archives of personal and official documents, photographs, film and video material, and oral history recordings; an extensive library, a large art collection, and examples of military vehicles and aircraft, equipment and other artefacts.\\u003c/p\\u003e\\n\\u003cp\\u003eThe museum is funded by government grants, charitable donations and revenue generation through commercial activity such as retailing, licensing, and publishing. Admission is free to IWM London and IWM North, but an admission fee is levied at the other branches. The museum is an exempt charity under the Charities Act 1993 and a non-departmental public body under the Department for Culture, Media and Sport. As of January 2012 the Chairman of the Trustees is Sir Francis Richards. Since October 2008, the museum's Director General has been Diane Lees.\\u003c/p\\u003e\\n\\u003cp\\u003e\\u003c/p\\u003e","$COLLECTION_IN_EUROPEANA$":"\\u003cdiv id='imperial_war_museums_-_collections' data-datacast_identifier='3fb41e769f03ab79c8f55d120ffeb80ee23b0718ee587d4104750f95d291105217' class='card_with_value' \\u003e\\u003c/div\\u003e","$RANKINGS_IN_EUROPEANA$":"\\u003cdiv id='imperial_war_museums_-_rankings' data-datacast_identifier='6de4ae83f13f98238f21124a46d2861fa1406a492351ce2c9e8fed04244b7ad198' class='box_table' \\u003e\\u003c/div\\u003e","$MEDIA_TYPES_CHART$":"\\u003cdiv id='imperial_war_museums_-_media_types' data-api='PykCharts.multiD.column' data-datacast_identifier='4eb098332b4467b49745702374dce365495c59edb8170643fbe9de0df7e1c00efd' class='d3-pykcharts' data-filter_present='false' data-filter_column_name=''\\u003e\\u003c/div\\u003e","$REUSABLES_CHART$":"\\u003cdiv id='imperial_war_museums_-_reusables' data-api='PykCharts.oneD.pie' data-datacast_identifier='411c8b229b1e4ca1e1f0c047347366aca4065ba7e0aebbdf57e1e5af21ca7e7967' class='d3-pykcharts' data-filter_present='false' data-filter_column_name=''\\u003e\\u003c/div\\u003e","$TRAFFIC_CHART$":"\\u003cdiv id='imperial_war_museums_-_traffic' data-api='PykCharts.multiD.groupedColumn' data-datacast_identifier='450fc106a7d125d076fc34a692f1f8f9cce7c75e9a3ec2e2e1f06923cc2fb100da' class='d3-pykcharts' data-filter_present='true' data-filter_column_name=''\\u003e\\u003c/div\\u003e","$LINE_CHART$":"\\u003cdiv id='imperial_war_museums_-_line_chart' data-api='PykCharts.multiD.multiSeriesLine' data-datacast_identifier='2081305c10c406d6c79cfbffc438624c6f3f8eda790af5c4e781b00dcf6debdb9d' class='d3-pykcharts' data-filter_present='true' data-filter_column_name=''\\u003e\\u003c/div\\u003e","$TOP_COUNTRIES_MAP$":"\\u003cdiv id='imperial_war_museums_-_top_countries' data-api='PykCharts.maps.oneLayer' data-datacast_identifier='a1eed8e0ae2b372d2c82982b901716e280ebae841776156f6852f9d449d03bc7c3' class='d3-pykcharts' data-filter_present='true' data-filter_column_name=''\\u003e\\u003c/div\\u003e","$TOP_DIGITAL_OBJECTS$":"\\u003cdiv id='imperial_war_museums_-_top_digital_objects' data-datacast_identifier='4ed715dfde1660a8f46bc8bdf2c19b87e2401d3e43f741d7815d4e5b7383d0a8b4' class='top_digital_objects'\\u003e\\u003c/div\\u003e"}	2015-09-03 07:42:35.653945	2015-09-17 12:35:45.781199	t	1
4	6	1	Rijksmuseum	rijksmuseum	<div> <div class="row"> <div class="col-sm-12"> <p>The <b>Rijksmuseum</b> (<small>Dutch pronunciation:</small> <span title="Representation in the International Phonetic Alphabet (IPA)">[ËrÉiÌ¯ksmyËzeËjÊm]</span>; English: State Museum) is a Netherlands national museum dedicated to arts and history in Amsterdam. The museum is located at the Museum Square in the borough Amsterdam South, close to the Van Gogh Museum, the Stedelijk Museum Amsterdam, and the Concertgebouw.</p>\n<p>The Rijksmuseum was founded in The Hague in 1800 and moved to Amsterdam in 1808, where it was first located in the Royal Palace and later in the Trippenhuis. The current main building was designed by Pierre Cuypers and first opened its doors in 1885. On 13 April 2013, after a ten-year renovation which cost â¬ 375 million, the main building was reopened by Queen Beatrix. In 2013 and 2014, it was the most visited museum in the Netherlands with record numbers of 2.2 million and 2.45 million visitors.</p>\n<p>The museum has on display 8,000 objects of art and history, from their total collection of 1 million objects from the years 1200â2000, among which are some masterpieces by Rembrandt, Frans Hals, and Johannes Vermeer. The museum also has a small Asian collection which is on display in the Asian pavilion.</p>\n<p></p> </div> <div class="col-sm-12"> <div class="col-sm-3"> <div id='rijksmuseum_-_collections' data-datacast_identifier='0143967394533f418f835ef4b0d3af6e925d60cd5f0b8ac75e21ca5c2853313d05' class='card_with_value' ></div> </div> </div> <div class="clearfix"></div> <div class="col-sm-12"> <h4>Ranking In Europeana</h4> <div class="col-sm-7"> <div id='rijksmuseum_-_rankings' data-datacast_identifier='3eb9f2c06be083dddb0f258307c516483b3debdafa938293e00a0f44b10e3b3084' class='box_table' ></div> </div> </div> <div class="col-sm-6"> <h4>Item Types</h4> <p>This chart displays a breakdown of the types of digital objects in this collection.</p> <div id='rijksmuseum_-_media_types' data-api='PykCharts.multiD.column' data-datacast_identifier='6637b7eb57dff7f79901c4f5b0a775763e72086fab47e65974f262ba24f4a8705b' class='d3-pykcharts' data-filter_present='false' data-filter_column_name=''></div> </div> <div class="col-sm-6"> <h4>Open for Re-Use</h4> <p>This chart displays what percentage of the collection is open for re-use.</p> <div id='rijksmuseum_-_reusables' data-api='PykCharts.oneD.pie' data-datacast_identifier='96a8ef29be3d94c978d49eafad825d2010a37247529622aea421d17fdc446fc0ae' class='d3-pykcharts' data-filter_present='false' data-filter_column_name=''></div> </div> <div class="col-sm-12"> <p>Use the the year filter below to filter all of the charts under it.</p> <span> Select year to view collection statistics on a per-year basis: <span id="id_year_filters"></span> </span> <h4>Views & Click-Throughs</h4> <p>This chart displays the views of the collection on the Europeana.eu website together with the number of times a user clicked through to the website of the data provider. Click-throughs are not measured prior to April 2012. (Filter chart by year above)</p> <div id='rijksmuseum_-_traffic' data-api='PykCharts.multiD.groupedColumn' data-datacast_identifier='c120b71fec137d06d6d6a182c1711ca68d55532ca666c4643bdea9ef378ef09628' class='d3-pykcharts' data-filter_present='true' data-filter_column_name=''></div> </div> <div class="col-sm-12"> <h4>Line Chart for Page view</h4> <p>This is a test visualization</p> <div id='rijksmuseum_-_line_chart' data-api='PykCharts.multiD.multiSeriesLine' data-datacast_identifier='9ab5c690efe34d0a1dae0e296e50ecde587ff466521f8902e6d04f04f37bd3fd47' class='d3-pykcharts' data-filter_present='true' data-filter_column_name=''></div> </div> <div class="col-sm-12"> <h4>Top 25 Countries</h4> <p>This chart displays the top 25 countries that generated the most views for this collection on Europeana.eu website. (Filter chart by year above and by quarter below)</p> <span id="id_quarter_filters"></span> </br> 