Johannes Vermeer. The museum also has a small Asian collection which is on display in the Asian pavilion.\\u003c/p\\u003e\\n\\u003cp\\u003e\\u003c/p\\u003e","$COLLECTION_IN_EUROPEANA$":"\\u003cdiv id='rijksmuseum_-_collections' data-datacast_identifier='0143967394533f418f835ef4b0d3af6e925d60cd5f0b8ac75e21ca5c2853313d05' class='card_with_value' \\u003e\\u003c/div\\u003e","$RANKINGS_IN_EUROPEANA$":"\\u003cdiv id='rijksmuseum_-_rankings' data-datacast_identifier='3eb9f2c06be083dddb0f258307c516483b3debdafa938293e00a0f44b10e3b3084' class='box_table' \\u003e\\u003c/div\\u003e","$MEDIA_TYPES_CHART$":"\\u003cdiv id='rijksmuseum_-_media_types' data-api='PykCharts.multiD.column' data-datacast_identifier='6637b7eb57dff7f79901c4f5b0a775763e72086fab47e65974f262ba24f4a8705b' class='d3-pykcharts' data-filter_present='false' data-filter_column_name=''\\u003e\\u003c/div\\u003e","$REUSABLES_CHART$":"\\u003cdiv id='rijksmuseum_-_reusables' data-api='PykCharts.oneD.pie' data-datacast_identifier='96a8ef29be3d94c978d49eafad825d2010a37247529622aea421d17fdc446fc0ae' class='d3-pykcharts' data-filter_present='false' data-filter_column_name=''\\u003e\\u003c/div\\u003e","$TRAFFIC_CHART$":"\\u003cdiv id='rijksmuseum_-_traffic' data-api='PykCharts.multiD.groupedColumn' data-datacast_identifier='c120b71fec137d06d6d6a182c1711ca68d55532ca666c4643bdea9ef378ef09628' class='d3-pykcharts' data-filter_present='true' data-filter_column_name=''\\u003e\\u003c/div\\u003e","$LINE_CHART$":"\\u003cdiv id='rijksmuseum_-_line_chart' data-api='PykCharts.multiD.multiSeriesLine' data-datacast_identifier='9ab5c690efe34d0a1dae0e296e50ecde587ff466521f8902e6d04f04f37bd3fd47' class='d3-pykcharts' data-filter_present='true' data-filter_column_name=''\\u003e\\u003c/div\\u003e","$TOP_COUNTRIES_MAP$":"\\u003cdiv id='rijksmuseum_-_top_countries' data-api='PykCharts.maps.oneLayer' data-datacast_identifier='17f7576df086858926e4fa93d0f6554a8fb747e350ec302403f26dc114e998b9d0' class='d3-pykcharts' data-filter_present='true' data-