7	\N	\N	About This Dashboard	about-this-dashboard	The Europeana Statistics Dashboard has been developed to act as a space where partners, researchers, stakeholders and anyone interested in Europeana can interact and re-use the statistics coming out of our websites and services. Europeana is a network, representing more than 2,500 cultural heritage organisations and a thousand individuals from these and other walks of life, passionate about bringing Europeâs vast wealth of cultural heritage to the world. \r\n\r\nTraditionally our statistics and metrics have been locked up in formatted documents, now we are liberating that data, visualising it and making it embeddable and re-useable. With this dashboard it is now much easier to see how Europeana has progressed and evolved through the years and how we are working to increase the reach of our data providersâ collections. Many of the visualisations are dynamic and utilise both the Europeana and Google Analytics APIs to generate charts that are accurate and up to date. \r\n\r\nSome of the key metrics that we are visualising in this dashboard include traffic and usage figures for the Europeana.eu website, social media reach, the size and composition of the Europeana repository, together with the number of digital object views on Europeana for a selection of our data providers. \r\n\r\nAn alpha version of the Statistics Dashboard was released in October 2014 and a beta version is due to be realised in 2015. During this alpha phase we are eager to hear your feedback, also if you are a data provider and would like to have statistics related to your collection available via this dashboard please [**contact us**][1].\r\n\r\n\r\n  [1]: http://statistics.europeana.eu/contact	{}	2015-09-15 11:27:05.320332	2015-09-15 11:27:05.320332	f	1
8	\N	\N	Content: 2014	content-2014	This section of the dashboard visualises various aspects of the digital objects available in the Europeana repository during 2014. Charts display the re-use status of the digital objects, the types of digital objects available, together with a breakdown from which countries the digital objects originate. All visualisations are broken down by quarter to see how Europeana has grown and evolved over time. Every month the Europeana aggregation team publishes new collections and updates to the Europeana repository from hundreds of institutions. \r\n\r\nThis entire article along with all individual charts is embeddable. Also the data from each visualisation is downloadable in CSV format. We encourage you to use these charts and data in your own research and reporting. If you would like more detailed statistics, please [**contact us**][1] and we will be more than happy to provide you with more information.\r\n\r\n<div class='row'><div class='col-sm-6'><H4>Total Items in Europeana & Re-use Status</H4>This chart displays the total number of digital objects in Europeana by re-use status between Q1 and Q4 of 2014. (Filter by quarter within the chart)\r\n<br><br/> \r\n<iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/hWlOO/3/" frameborder="0" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="550" height="350"></iframe></div><div class='col-sm-6'><H4>Breakdown of Item Types in Europeana</H4>This chart displays a breakdown of the types of digital objects in  Europeana between Q1 and Q4 of 2014. (Filter by quarter within the chart)<p></p><iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/8lK9X/2/" frameborder="0" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="550" height="350"></iframe></div></div>\r\n<p><p/>\r\n<H4>Items Per Country in Europeana</H4>\r\nThis chart displays a breakdown from which countries the digital objects in Europeana originate between Q1 and Q4 of 2014. (Filter by quarter within the chart)\r\n<iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/ciM2u/3/" frameborder="0" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="100%" height="550"></iframe>\r\n\r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n  [1]: http://statistics.europeana.eu/contact\r\n	{}	2015-09-15 11:27:05.410175	2015-09-15 11:27:05.410175	f	1
9	\N	\N	Traffic & Usage: 2014	traffic-usage-2014	This section of the dashboard visualises the main traffic dimensions of web traffic and usage on the Europeana.eu website in 2014. Social media and Wikipedia related statistics are also visualised to showcase the increased reach of data providersâ collections outside of the Europeana.eu website. \r\n\r\nAll charts show data from 2014 and many of them can be broken down by quarter. The data in this section is sourced from Google Analytics for traffic, BaGLAMa for Wikipedia, Facebook Insights and Pinterest Analytics. \r\n\r\nThis entire article along with all individual charts is embeddable. Also the data from each visualisation is downloadable in CSV format. We encourage you to use these charts and data in your own research and reporting. If you would like more detailed statistics, please [**contact us**][1] and we will be more than happy to provide you with more information.\r\n\r\n<div class='row'><div class='col-sm-6'>\r\n<H4> Europeana.eu: Pageviews, Visits & Click-throughs</H4>\r\nThe chart displays number of pageviews and visits on the Europeana.eu website together with the number of times a user clicked through to the website of a data provider between Q1 and Q4 of 2014. (Filter by quarter within the chart)\r\n<p></p>\r\n<iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/zBTeq/3/" frameborder="0" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="450" height="350"></iframe></iframe></iframe>\r\n</div>\r\n\r\n<h4>Europeana.eu: New vs. Returning Visits</h4>\r\nThis chart displays the percentage of new and returning visits to the Europeana.eu website between Q1 and Q4 of 2014. \r\n(Filter by quarter within the chart)\r\n<p><p/>\r\n<iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/v8tVW/3/" frameborder="0" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="450" height="350"></iframe>\r\n\r\n</div></div>\r\n\r\n<H4> Europeana.eu: Top 100 Countries</H4>\r\nThis chart displays the top 100 countries based on the number of visits to the Europeana.eu website between Q1 and Q4 of 2014.\r\n<iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/JxVDs/4/" frameborder="0" scrolling="no" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="100%" height="600"></iframe>\r\n\r\n<div class='row'><div class='col-sm-6'>\r\n<h4>Europeana.eu: Traffic Sources</h4>\r\n\r\nThis chart displays a breakdown of traffic sources based on the number of visits to the Europeana.eu website between Q1 and Q4 of 2014. (Filter by quarter within the chart)\r\n<p></p>\r\n<iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/862Cw/3/" frameborder="0" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="450" height="350"></iframe>\r\n\r\n<h4>Europeana.eu: Digital Object & Search Result Pageviews</h4>\r\n\r\nThis chart displays the number of pageviews of digital objects and search result pages on the Europeana.eu website between Q1 and Q4 2014.\r\n<p></p>\r\n<iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/EXwbm/4/" frameborder="0" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="450" height="350"></iframe>\r\n<div class='row'><div class='col-sm-6'></div>\r\n\r\n\r\n\r\n\r\n</div></div>\r\n\r\n<div class='row'><div class='col-sm-6'>\r\n\r\n<h4>Europeana.eu: Tablet & Mobile Devices</h4>\r\n\r\nThis chart displays a breakdown of visits to the Europeana.eu website that were from a desktop, tablet or mobile device between Q1 and Q4 of 2014. (Filter by quarter within the chart)\r\n<p></p>\r\n<iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/tWMNz/3/" frameborder="0" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="450" height="350"></iframe>\r\n</div>\r\n\r\n<h4>Europeana.eu: Search Usage</h4>\r\n\r\nThis chart displays the number of visits during which at least one search occurred together with the number of unique times a search was performed on the Europeana.eu website between Q1 and Q4 2014.\r\n<p></p>\r\n<iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/lCOAz/7/" frameborder="0" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="450" height="350"></iframe>\r\n</div>\r\n\r\n</div></div>\r\n\r\n<h4>Off-site reach: Impressions on Wikipedia, Facebook & Pinterest</h4>\r\nThis chart displays the number of impressions of cultural heritage collections on Wikipedia, Facebook and Pinterest as a result of Europeanaâs outreach activities between Q1 and Q4 of 2014.\r\n<iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/PYywJ/4/" frameborder="0" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="100%" height="450"></iframe>