12	\N	\N	Data Providers	data-providers	In this section of the dashboard you are able to explore the traffic and usage statistics for a selection of Europeana data providers. Individual reports have been generated for each provider and they are broken down by both year and quarter. These reports include key metrics on the size and composition of the collection provided, together with the number of pageviews for digital objects on the Europeana.eu website and the number click-throughs to the website of the provider. Reports also include top 25 countries based on the pageviews and a top 10 list of the most viewed digital objects in the collection. \r\n\r\nIf you are a data-provider and would like to see your statistics presented in this dashboard, please [**contact us**][1] and we will generate your report.\r\n\r\n<h4>Available Data Provider Reports:</h4>\r\n\r\n<div class='row'><div class='col-sm-12 grid-view-layout'><h3><p><p/>\r\n<a href="http://statistics.europeana.eu/biblioteca-de-catalunya">Biblioteca de Catalunya</a></h3></a><p><a href="http://statistics.europeana.eu/biblioteca-de-catalunya">The Library of Catalonia is a national library located in Barcelona, Spain. The mission of the Library of Catalonia is to collect, preserve, and spread Catalonian bibliographic production.</p></div></div>\r\n\r\n<div class='row'><div class='col-sm-12 grid-view-layout'><h3><p><p/><a href="http://statistics.europeana.eu/national-library-of-france">National Library of France</h3><p>The BibliothÃ¨que nationale de France is the National Library of France, located in Paris. It is intended to be the repository of all that is published in France.</p></div></div>\r\n\r\n<div class='row'><div class='col-sm-12 grid-view-layout'><h3><p><p/><a href="http://statistics.europeana.eu/imperial-war-museums">Imperial War Museums</h3><p>Imperial War Museums was founded as the Imperial War Museum in 1917, the museum was intended to record the civil and military war effort and sacrifice of Britain and its Empire during the First World War.</p></div></div>\r\n\r\n<div class='row'><div class='col-sm-12 grid-view-layout'><h3><p><p/><a href="http://statistics.europeana.eu/national-library-of-wales">National Library of Wales</h3><p>The National Library of Wales is the national legal deposit library of Wales. The library houses over 4 million printed volumes, including many rare books such as the first book printed in Welsh.</p></div></div>\r\n\r\n<div class='row'><div class='col-sm-12 grid-view-layout'><h3><p><p/><a href="http://statistics.europeana.eu/the-wellcome-library">Wellcome Library</h3><p>The Wellcome Library is founded on the collection formed by Sir Henry Wellcome (1853â1936), whose personal wealth allowed him to create one of the most ambitious collections of the 20th century.</p></div></div>\r\n\r\n\r\n\r\n\r\n  [1]: http://statistics.europeana.eu/contact	{}	2015-09-15 11:27:05.51902	2015-09-15 11:27:05.51902	f	1
