3	3	1	Biblioteca de Catalunya	biblioteca-de-catalunya	<div> <div class="row"> <div class="col-sm-12"> <p>The <b>National Library of Catalonia</b> (Catalan: <span lang="ca" xml:lang="ca"><i>Biblioteca de Catalunya</i></span>, <small>IPA:Â </small><span title="Representation in the International Phonetic Alphabet (IPA)">[biÎ²É«iuËtÉkÉ Ã°É kÉtÉËÉ«uÉ²É]</span>) is a Catalan national library located in Barcelona, Spain. The mission of the Library of Catalonia is to collect, preserve, and spread Catalonian bibliographic production and that related to the Catalonian linguistic area, to look after its conservation, and to spread its bibliographic heritage while maintaining the status of a center for research and consultation.</p>\n<p>It occupies 8,820 mÂ² and has about three million items.</p>\n<p></p> </div> <div class="col-sm-12"> <div class="col-sm-3"> <div id='biblioteca_de_catalunya_-_collections' data-datacast_identifier='954b0cbab653272ce6a906e11c08c2b0bd7fad6b259f0d62d407e98272ea0e12b3' class='card_with_value' ></div> </div> </div> <div class="clearfix"></div> <div class="col-sm-12"> <h4>Ranking In Europeana</h4> <div class="col-sm-7"> <div id='biblioteca_de_catalunya_-_rankings' data-datacast_identifier='9898df38945bffcd5b7ff6d2c84fab081c95d173b599e48c4cd6bbf45029a092d2' class='box_table' ></div> </div> </div> <div class="col-sm-6"> <h4>Item Types</h4> <p>This chart displays a breakdown of the types of digital objects in this collection.</p> <div id='biblioteca_de_catalunya_-_media_types' data-api='PykCharts.multiD.column' data-datacast_identifier='34775380fb1ca2d2e1ecb3749411529310483d15a8f4894462c6a760af55438ba1' class='d3-pykcharts' data-filter_present='false' data-filter_column_name=''></div> </div> <div class="col-sm-6"> <h4>Open for Re-Use</h4> <p>This chart displays what percentage of the collection is open for re-use.</p> <div id='biblioteca_de_catalunya_-_reusables' data-api='PykCharts.oneD.pie' data-datacast_identifier='c4b34851ec88336c0016cfe8e8d