17	\N	\N	Welcome	welcome	<H4>Please note that this dashboard is currently in an alpha phase of development, therefore you may encounter a number of issues when testing this service. During this alpha phase we are eager to hear [your feedback][1].</H4>\r\n\r\nWelcome to the Europeana Statistics Dashboard; a dynamic space where we crunch and visualise the key metrics coming out of [**Europeana**][2]. We invite you to explore, interact and re-use the visualisations in this dashboard which are ordered into the following three categories; Content, Traffic & Usage, and Data Providers. The [**Content**][3] section visualises statistics related to the number of digital objects available in the Europeana repository. The [**Traffic & Usage**][4] section visualises statistics related to web traffic on the Europeana.eu website together with statistics related to Europeanaâs reach on social media and Wikipedia. And finally the [**Data Providers**][5] section visualises statistics related to traffic and usage on the Europeana.eu website for a number of data providers.\r\n\r\n<div class='col-sm-3' style='margin:0px;padding:0px'>\r\n<div id='one_number_for_visits_in_2014' data-api='one-number-indicator' data-datacast_identifier='17da8be6c74462ca15ed7f902f39bdc9011821975cbdea0bee7fab173f9a9557e4' class='card_with_value' data-filter_present='false' data-filter_column_name='Select filter column'></div>\r\n</div>\r\n<div class='col-sm-3' style='margin:0px;padding:0px'>\r\n<div id='total_visits_in_2015_difference_in_2014' data-api='one-number-indicator' data-datacast_identifier='1326daf6a71661fe357e604474a974d3402080cf5b4b89df0f7541e0ac10793f04' class='card_with_value' data-filter_present='false' data-filter_column_name='Select filter column'></div>\r\n</div>\r\n<div class='col-sm-3' style='margin:0px;padding:0px'>\r\n<div id='total_items_in_europeana' data-api='one-number-indicator' data-datacast_identifier='83ffa80336f0001213f5c456992aeb203a1920d32d965df62e04fb162b91a7a6bc' class='card_with_value' data-filter_present='false' data-filter_column_name='Select filter column'></div>\r\n</div>\r\n<div class='col-sm-3' style='margin:0px;padding:0px'>\r\n<div id='total_pageviews_in_2015' data-api='one-number-indicator' data-datacast_identifier='33380f513283e9a4516e30ca2f740229e34553298511877ad146cbf44b093a57c9' class='card_with_value' data-filter_present='false' data-filter_column_name='Select filter column'></div>\r\n</div>\r\n<div class='clearfix'></div>\r\n</br>\r\n<H3>Increasing the Reach of Cultural Collections</H3>\r\nThis chart displays the number of pageviews on Europeana's end-user websites (E*uropeana.eu, Exhibitions, Blog, Europeana 1914-1918 and Europeana 1989*) together with the number of impressions generated on social media and Wikipedia since 2011. \r\nImpressions on social media where generated using data providers' collections on Facebook and Pinterest via Europeana.eu, Europeana 1989 and Europeana 1914-1918 profiles. While impressions on Wikipedia are based on the total number of views of Wikipedia articles that include images uploaded to Wikimedia Commons that are directly related to Europeana, or related to Europeanaâs outreach activities with the Wiki community. Explore more statistics related to social media and Wikipedia in [**Traffic & Usage**][6] section of this dashboard.\r\n\r\n<iframe src="//dw-europeana.s3-website-us-west-2.amazonaws.com/DCqc2/15/" frameborder="0" allowtransparency="true" allowfullscreen="allowfullscreen" webkitallowfullscreen="webkitallowfullscreen" mozallowfullscreen="mozallowfullscreen" oallowfullscreen="oallowfullscreen" msallowfullscreen="msallowfullscreen" width="100%" height="600"></iframe>\r\n\r\n<div class='col-sm-6'>\r\n<h3>Total Visits for the portal in 2015</h3>\r\n<div id='column_chart_for_visits_in_2015' data-api='PykCharts.multiD.column' data-datacast_identifier='d2ff1fb9aa7fcb1fda79dd6a23e892e7d6ec67f5a0950081d5141e87bbec69b803' class='d3-pykcharts' data-filter_present='false' data-filter_column_name='Select filter column'></div>\r\n</div>\r\n\r\n<div class='col-sm-6'>\r\n<h3>Total Visits for the portal in 2015 in comparison to 2014</h3>\r\n<div id='multi_series_line_chart_for_2014_and_2015' data-api='PykCharts.multiD.multiSeriesLine' data-datacast_identifier='773145add2b25278f6a7c9104049e3e1ef789949db3f7f7f187852290838bbb839' class='d3-pykcharts' data-filter_present='false' data-filter_column_name='Select filter column'></div>\r\n</div>\r\n\r\n<div class='col-sm-6'>\r\n<h3>Total Visits for the Portal in 2015 per medium - Bubble Chart</h3>\r\n\r\n<div id='bubble_for_visits_in_2015' data-api='PykCharts.oneD.bubble' data-datacast_identifier='bda031289f40941767139c8ce88eed8cbfeb41d091a7648c7eeddc003d300f5b66' class='d3-pykcharts' data-filter_present='false' data-filter_column_name='Select filter column'></div>\r\n</div>\r\n\r\n<div class='col-sm-6'>\r\n<h3>Total Visits for the Portal in 2015 per medium -  Treemap</h3>\r\n\r\n<div id='tree_map_for_visits_in_2015' data-api='PykCharts.oneD.treemap' data-datacast_identifier='bda031289f40941767139c8ce88eed8cbfeb41d091a7648c7eeddc003d300f5b66' class='d3-pykcharts' data-filter_present='false' data-filter_column_name='Select filter column'></div>\r\n\r\n</div>\r\n\r\n\r\n  [1]: http://statistics.europeana.eu/contact\r\n  [2]: http://pro.europeana.eu/about\r\n  [3]: http://statistics.europeana.eu/content\r\n  [4]: http://statistics.europeana.eu/traffic-usage\r\n  [5]: http://statistics.europeana.eu/data-providers\r\n  [6]: http://statistics.europeana.eu/traffic-usage	{}	2015-09-15 11:27:05.638456	2015-10-08 05:02:57.27807	f	1
