76	Choropleth	Choropleth are map charts that use several colours or a single colour with various saturations in order to represent a data set over a geographical map. They provide a snapshot of how magnitude of data varies by geographic location, the magnitude of data being represented by the variation in saturation or hues of colours. Choropleth maps are best used when one wishes to provide a snapshot for a fixed/static moment in time	https://s3-ap-southeast-1.amazonaws.com/charts.pykih.com/icons/world-heat.png	Map Charts	{"dimensions_required":1,"metrics_required":1,"dimensions_alias":["iso2"],"metrics_alias":["size"]}	PykCharts.maps.oneLayer	\N	\N	 https://s3-ap-southeast-1.amazonaws.com/charts.pykih.com/icons/data.map.png	one-layer-map	CH	PykCharts/src/js/maps/maps.js	PykCharts/src/js/maps/oneLayer.js	1
